import * as d3 from "d3";

async function getData() {
  var filePath = "src/data/Avocado_HassAvocadoBoard_20152023v1.0.1.csv"
  const data = await d3.csv(filePath, (row) => {
      return {
          date: new Date(row.Date),
      };
  });
  return data;
}

export default function Chart1({
}) {
  const datas = getData();
  return (
    <div>
      {datas}
    </div>
  );
}
